<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1">
  <title>SVG Zoom on Hover</title>
  <style>
    body {
      display: flex;
      justify-content: center;
      align-items: center;
      height: 100vh;
      background: #f4f4f4;
    }

    svg {
      width: 900px;
      height: 500px;
      border: 2px solid #333;
    }

    .icon {
      position: absolute;
      width: 100px;
      height: auto;
      transition: transform 0.3s ease;
      cursor: pointer;
    }

  

    .history {
      /* transition: transform 0.3s ease; */
      transform-origin: center; 
      position: absolute;
      width: 100%;
      height: auto;
      transition: transform 0.9s ease ;
      cursor: pointer;
    }

    .history:hover {
      transform: scale(1.1); 
    }
  </style>
